    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in February of 1937. Work continued on preparing
    posts for the fencing project and constructing tables and benches for the recreation
    area project. Predator control activities were still slow, but hopes are up for
    better success as the weather starts to warm up.",nt"license_title": "License
